    <div className="section-container">
      <div className="title">
        <h1>Optimisation énergétique</h1>
        <p>
          Ceci est un paragraphe descriptif pour la section. Vous pouvez y ajouter des informations pertinentes
          pour expliquer le contenu ou le contexte de l'image à droite.
        </p>
      </div>
      <div className="section-image">
        <img src="path-to-your-image.png" alt="Description de l'image" />
      </div>
    </div>
  );
}

export default Section;
